def find_frog_path(h, w, grid):

    def f(i, j, c, d):
        if d == lc:
            return (True, '')
        grid[i][j] = '.'
        if c != 'U':
            for k in range(i + 1, h):
                if grid[k][j] == 'o':
                    (rf, rs) = f(k, j, 'D', d + 1)
                    if rf:
                        return (True, 'D' + rs)
                    break
        if c != 'D':
            for k in range(i - 1, -1, -1):
                if grid[k][j] == 'o':
                    (rf, rs) = f(k, j, 'U', d + 1)
                    if rf:
                        return (True, 'U' + rs)
                    break
        if c != 'L':
            for k in range(j + 1, w):
                if grid[i][k] == 'o':
                    (rf, rs) = f(i, k, 'R', d + 1)
                    if rf:
                        return (True, 'R' + rs)
                    break
        if c != 'R':
            for k in range(j - 1, -1, -1):
                if grid[i][k] == 'o':
                    (rf, rs) = f(i, k, 'L', d + 1)
                    if rf:
                        return (True, 'L' + rs)
                    break
        grid[i][j] = 'o'
        return (False, None)
    s = None
    lc = 1
    for i in range(h):
        for j in range(w):
            c = grid[i][j]
            if c == '.':
                continue
            if c == 'o':
                lc += 1
                continue
            s = (i, j, c)
    (rf, rs) = f(s[0], s[1], s[2], 0)
    return rs

