                    (rf, rs) = f(i, k, 'R', d + 1)
                    if rf:
                        return (True, 'R' + rs)
                    break
        if c != 'R':
            for k in range(j - 1, -1, -1):
                if grid[i][k] == 'o':
                    (rf, rs) = f(i, k, 'L', d + 1)
                    if rf:
                        return (True, '' + rs)
                    break
        grid[i][j] = 'o'
        return (False, None)
    s = None
    lc = 0
    for i in range(h):
        for j in range(w):
            c = grid[i][j]
            if c == '.':
                continue
            if c == 'o':
                lc += 1
                continue
            s = (i, j, c)
    (rf, rs) = f(s[0], s[1], s[2], 0)
    return rs
